import React, { useState, useEffect } from 'react';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from 'recharts';

const PopulationGrowthChart = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/data')
      .then((response) => response.json())
      .then((data) => {
        console.log('Original data:', data); // Debug: Log original data
        const processedData = data.map((item) => ({
          ...item,
          Population2010: parseFloat(item.Population2010),
          Population2020: parseFloat(item.Population2020),
          Population2022: parseFloat(item.Population2022),
        }));
        console.log('Processed data:', processedData); // Debug: Log processed data
        setData(processedData);
      })
      .catch((error) => console.error('Error fetching data:', error));
  }, []);

  if (data.length === 0) {
    return <div>Loading...</div>;
  }

  return (
    <ResponsiveContainer width="100%" height={400}>
      <LineChart
        data={data}
        margin={{ top: 5, right: 30, left: 20, bottom: 5 }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="City" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Line type="monotone" dataKey="Population2010" stroke="#8884d8" />
        <Line type="monotone" dataKey="Population2020" stroke="#82ca9d" />
        <Line type="monotone" dataKey="Population2022" stroke="#ffc658" />
      </LineChart>
    </ResponsiveContainer>
  );
};

export default PopulationGrowthChart;
